import React, { useState } from 'react';
import { Card } from '../components/Card';
import { Disclaimer } from '../components/Disclaimer';
import { Input, Select } from '../components/Inputs';
import { Chip, ChipGroup } from '../components/Chips';
import { formatCurrency } from '../utils/format';
import './Settings.css';

export function Settings() {
  const [userProfile, setUserProfile] = useState({
    name: '',
    age: 25,
    income: 50000,
    riskTolerance: 'moderate' as 'conservative' | 'moderate' | 'aggressive'
  });

  const [preferences, setPreferences] = useState({
    currency: 'USD',
    notifications: true,
    darkMode: false,
    dataSharing: false
  });

  const riskToleranceOptions = [
    { value: 'conservative', label: 'Conservative' },
    { value: 'moderate', label: 'Moderate' },
    { value: 'aggressive', label: 'Aggressive' }
  ];

  const currencyOptions = [
    { value: 'USD', label: 'US Dollar ($)' },
    { value: 'EUR', label: 'Euro (€)' },
    { value: 'GBP', label: 'British Pound (£)' },
    { value: 'CAD', label: 'Canadian Dollar (C$)' }
  ];

  const getRiskDescription = (risk: string) => {
    switch (risk) {
      case 'conservative':
        return 'Lower risk, more stable returns';
      case 'moderate':
        return 'Balanced risk and return';
      case 'aggressive':
        return 'Higher risk, potential for higher returns';
      default:
        return '';
    }
  };

  return (
    <div className="settings">
      <div className="settings-header">
        <h1 className="settings-title">Settings</h1>
        <p className="settings-subtitle">
          Customize your Guidewell experience
        </p>
      </div>

      <Disclaimer />

      <div className="settings-content">
        {/* Profile Settings */}
        <Card className="settings-section">
          <h3 className="section-title">Profile Information</h3>
          <div className="settings-form">
            <Input
              label="Name"
              value={userProfile.name}
              onChange={(e) => setUserProfile({ ...userProfile, name: e.target.value })}
              placeholder="Enter your name"
            />

            <Input
              label="Age"
              type="number"
              value={userProfile.age}
              onChange={(e) => setUserProfile({ ...userProfile, age: parseInt(e.target.value) || 25 })}
              helperText="Used for age-appropriate financial recommendations"
            />

            <Input
              label="Annual Income"
              type="number"
              value={userProfile.income}
              onChange={(e) => setUserProfile({ ...userProfile, income: parseInt(e.target.value) || 50000 })}
              helperText={`Current income: ${formatCurrency(userProfile.income)}`}
            />

            <Select
              label="Risk Tolerance"
              value={userProfile.riskTolerance}
              onChange={(e) => setUserProfile({ ...userProfile, riskTolerance: e.target.value as 'conservative' | 'moderate' | 'aggressive' })}
              options={riskToleranceOptions}
              helperText={getRiskDescription(userProfile.riskTolerance)}
            />
          </div>
        </Card>

        {/* Preferences */}
        <Card className="settings-section">
          <h3 className="section-title">Preferences</h3>
          <div className="preferences-grid">
            <div className="preference-item">
              <div className="preference-info">
                <h4>Currency</h4>
                <p>Default currency for all calculations</p>
              </div>
              <Select
                value={preferences.currency}
                onChange={(e) => setPreferences({ ...preferences, currency: e.target.value })}
                options={currencyOptions}
              />
            </div>

            <div className="preference-item">
              <div className="preference-info">
                <h4>Notifications</h4>
                <p>Receive updates about your goals and strategies</p>
              </div>
              <label className="toggle-switch">
                <input
                  type="checkbox"
                  checked={preferences.notifications}
                  onChange={(e) => setPreferences({ ...preferences, notifications: e.target.checked })}
                />
                <span className="toggle-slider"></span>
              </label>
            </div>

            <div className="preference-item">
              <div className="preference-info">
                <h4>Dark Mode</h4>
                <p>Switch to dark theme (coming soon)</p>
              </div>
              <label className="toggle-switch">
                <input
                  type="checkbox"
                  checked={preferences.darkMode}
                  onChange={(e) => setPreferences({ ...preferences, darkMode: e.target.checked })}
                  disabled
                />
                <span className="toggle-slider"></span>
              </label>
            </div>

            <div className="preference-item">
              <div className="preference-info">
                <h4>Data Sharing</h4>
                <p>Help improve Guidewell by sharing anonymous usage data</p>
              </div>
              <label className="toggle-switch">
                <input
                  type="checkbox"
                  checked={preferences.dataSharing}
                  onChange={(e) => setPreferences({ ...preferences, dataSharing: e.target.checked })}
                />
                <span className="toggle-slider"></span>
              </label>
            </div>
          </div>
        </Card>

        {/* Account Actions */}
        <Card className="settings-section">
          <h3 className="section-title">Account</h3>
          <div className="account-actions">
            <button className="action-button secondary">
              Export Data
            </button>
            <button className="action-button secondary">
              Reset Settings
            </button>
            <button className="action-button danger">
              Delete Account
            </button>
          </div>
        </Card>

        {/* App Information */}
        <Card className="settings-section">
          <h3 className="section-title">About Guidewell</h3>
          <div className="app-info">
            <div className="info-item">
              <span className="info-label">Version</span>
              <span className="info-value">1.0.0</span>
            </div>
            <div className="info-item">
              <span className="info-label">Last Updated</span>
              <span className="info-value">January 2024</span>
            </div>
            <div className="info-item">
              <span className="info-label">Privacy Policy</span>
              <span className="info-value link">View Policy</span>
            </div>
            <div className="info-item">
              <span className="info-label">Terms of Service</span>
              <span className="info-value link">View Terms</span>
            </div>
          </div>
        </Card>
      </div>
    </div>
  );
}
